import React from 'react';



let state = {
    profile:{
        PostsData:[
            {id:1, messange:"hi", like:12},
            {id:2, messange:"hi", like:23}
        ],
        DialogsData:[
            {id:1, name:"Mike"},
            {id:2, name:"Vlad"},
            {id:3, name:"Petr"},
            {id:4, name:"Nastya"},
            {id:5, name:"Artem"}

        ]
    },

    MessageData:[
        {id:1, messange:"hi"},
        {id:2, messange:"hi"},
        {id:3, messange:"hi"},
        {id:4, messange:"hi"},
        {id:5, messange:"hi"}
    ]

}

export default state;
